import React, { useEffect, useState } from "react";
import axios from "axios";
import Cookies from "js-cookie";
import { useNavigate } from "react-router-dom";
import Footer from "./Footer";
import Header from "./Header";

export default function Dashboard() {
  const navigate = useNavigate();
  const [data, setData]= useState([])
  const [authentication, setAuthentication] = useState(false);

  const auth = () => {
    axios({
      url: "http://localhost:3001/user/user-auth/",
      method: "post",
      data: {
        token: Cookies.get("userToken"),
      },
    })
      .then((res) => {
        if (res.data.status == 200) {
          setAuthentication(true);
        } else if (res.data.status == 400) {
          setAuthentication(false);
          navigate("/login");
        } else {
          setAuthentication(false);
          navigate("/login");
        }
      })
      .catch((err) => {
        if (err) {
          setAuthentication(false);
          navigate("/login");
        }
      });
  };
  useEffect(() => {
    auth();
  });
  const getData = ()=>{
    axios({
      url: "http://localhost:3001/user/view/",
      method: "post",
      data: {_id:Cookies.get("userId")}
    }).then((data)=>{
      setData(data.data)
    }).catch((err)=>{
      console.log(err)
    })
  }
  useEffect(()=>{
    getData()
  },[])

  return (
    <>
      <Header />
      <div className="dashboard">
        <div className="container">
          <div className="row">
            <div className="col-md-10 m-auto mt-5 mb-5 border-dash">
            <h2 className="mb-5">Dashboard</h2>
              <div className="row">
                <div className="col-md-3 dash-sidebar">
                  <div className="nav nav-active">
                    <span>
                      <a href="">Profile</a>
                    </span>
                  </div>
                  <div className="nav">
                    <span>
                      <a href="">Address</a>
                    </span>
                  </div>
                  <div className="nav">
                    <span>
                      <a href="">Orders</a>
                    </span>
                  </div>
                  <div className="nav">
                    <span>
                      <a href="">Change Password</a>
                    </span>
                  </div>
                </div>
                <div className="col-md-9 dash-item">
                 
                 {
                  data.map((item,index)=>{
                    return(
                    <div className="profile">
                      <div className="row">
                        <div className="col-md-12">
                          <div className="d-flex">
                            <span>Name: </span>
                            <p>{item.name}</p>
                          </div>
                        </div>
                        <div className="col-md-12">
                          <div className="d-flex">
                            <span>Email: </span>
                            <p>{item.email}</p>
                          </div>
                        </div>
                        <div className="col-md-12">
                          <div className="d-flex">
                            <span>Phone Number: </span>
                            <p>{item.phone}</p>
                          </div>
                        </div>
                        
                      </div>
                    </div>
                    )
                  })
                 }
                  



                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
      <Footer />
    </>
  );
}
